    false,nt"url": null,nt"notes": "The National Land Cover Database (NLCD)
    Percent Developed Imperviousness Collection is produced through a cooperative project
    conducted by the Multi-Resolution Land Characteristics (MRLC) Consortium (www.mrlc.gov).
    The MRLC Consortium is a partnership of Federal agencies, consisting of the U.S.
    Geological Survey, the National Oceanic and Atmospheric Administration, the U.S.
    Environmental Protection Agency, the U.S. Department of Agriculture (USDA) National
    Agricultural Statistics Service, the U.S. Forest Service, the National Park Service,
    the U.S. Fish and Wildlife Service, the Bureau of Land Management, NASA, and the
    U.S. Army Corps of Engineers. A primary goal of the MRLC Consortium is to generate
    current, consistent, and seamless national datasets of land cover, percent developed
    imperviousness, and percent tree canopy. NLCD 2001 percent developed imperviousness
    was created by partitioning the conterminous United States into 66 mapping zones,
    based on ecoregion and geographical characteristics, edge matching features, and
    the size requirement of Landsat mosaics. NLCD 2001 represents a seamless assembly
    of percent developed imperviousness for all 66 MRLC mapping zones. NLCD 2001 percent
    developed imperviousness was developed for all 50 states and Puerto Rico / U.S.
    Virgin Islands. NLCD 2006 percent developed imperviousness was created on a path/row
    basis and mosaicked to create a seamless national product. NLCD 2006 percent developed
    imperviousness was developed for the conterminous United States. NLCD 2011 percent
    developed imperviousness was created on a path/row basis and mosaicked to create
    a seamless national product. The data in NLCD 2011 are completely integrated with
    NLCD 2001 and NLCD 2006. As part of the NLCD 2011 project, the NLCD 2001 and 2006
    percent developed imperviousness data products were revised and reissued to provide
    full compatibility with the new NLCD 2011 products. The 2014 amended version corrects
    for the over-elimination of small areas of the four developed classes. NLCD 2011
    percent developed imperviousness was developed for the conterminous United States
    and Alaska. Questions about the NLCD Percent Developed Imperviousness Collection
    can be directed to the NLCD land cover mapping team at USGS EROS, Sioux Falls, SD
    (605) 594-6151 or mrlc@usgs.gov.",nt"license_title": null,nt"extras": [{ntt"key":
